import React, { Component } from 'react'
import SearchBar from '../'

export default class InstructorList extends Component {
    state = {
        data:[]
    }
    componentDidMount(){
        this.setState({
            data:['Micheal Owen', 'Gary Neville', 'Rio Ferdinand', 'John Terry']
        });
    }
    render() {
        return (
            <div>
                <SearchBar/>
                <h1>Instructors</h1>
                {this.state.data.map((val, index)=>(
                    <li>{val}</li>
                ))}
            </div>
        )
    }
}
